contract DeleteExample {
    uint public data = 1;
   uint[] public arrydata =[1,2];

    function deldata()external {
        delete data;
    }
    // 
    function delarrydata0()external {
        delete arrydata[0];
    }
    //直接删除数组的话  会导致数组的长度变成0
    function delarrydata()external {
        delete arrydata;
    }


}

